<?phpnamespace Nemundo\Model\Data\Property\Image;use Nemundo\Core\Image\Cropping\CroppingDimension;use Nemundo\Model\Data\Property\AbstractDataProperty;use Nemundo\Model\Data\Property\File\FileDataProperty;use Nemundo\Model\Type\File\CroppingImageType;class CroppingImageDataProperty extends AbstractDataProperty{    /**     * @var CroppingImageType     */    protected $type;    public function saveOrginalFile($filename)    {        $image = new FileDataProperty($this->type->orginalImage, $this->typeValueList);        $image->fromFilename($filename);        return $this;    }    public function saveCroppingFile($filename)    {        $image = new FileDataProperty($this->type->croppingImage, $this->typeValueList);        $image->fromFilename($filename);        return $this;    }    public function saveCroppingDimension(CroppingDimension $croppingDimension)    {        $this->typeValueList->setModelValue($this->type->x, $croppingDimension->x);        $this->typeValueList->setModelValue($this->type->y, $croppingDimension->y);        $this->typeValueList->setModelValue($this->type->width, $croppingDimension->width);        $this->typeValueList->setModelValue($this->type->heigth, $croppingDimension->height);        return $this;    }}